import React from 'react';

const DrumKeys = (props) => {
    return (
        <div className="DrumKeys">

          {props.text.map((drumkey, index) => (
            <button className="btn btn-primary" key={drumkey.id} type="button" value={drumkey.letter}>{drumkey.letter}</button>
          ))
        }
        </div>
    )
}
export default DrumKeys;
